#
# Структура для таблицы `ymarket_products`: 
#

CREATE TABLE `ymarket_products` (
  `id` INTEGER(11) UNSIGNED NOT NULL AUTO_INCREMENT,
  `brand_id` INTEGER(11) UNSIGNED DEFAULT 0 COMMENT 'Брэнд',
  `name` VARCHAR(150) COLLATE utf8_general_ci NOT NULL COMMENT 'Название',
  `image` VARCHAR(38) COLLATE utf8_general_ci DEFAULT NULL COMMENT 'Картинка',
  `desc_html` TEXT COLLATE utf8_general_ci COMMENT 'Описание (HTML)',
  `date_create` TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT 'Добавлен',
  `date_update` DATETIME DEFAULT NULL COMMENT 'Дата обновления',
  PRIMARY KEY USING BTREE (`id`) COMMENT '',
  UNIQUE INDEX `brand_id_name` USING BTREE (`brand_id`, `name`) COMMENT '',
  CONSTRAINT `barnd_fk` FOREIGN KEY (`brand_id`) REFERENCES `ymarket_brands` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
)ENGINE=InnoDB
AUTO_INCREMENT=1811 AVG_ROW_LENGTH=1771 CHARACTER SET 'utf8' COLLATE 'utf8_general_ci'
COMMENT=''
;

